/**
 * Feeds an image to posenet to estimate poses - this is where the magic happens.
 * This function loops with a requestAnimationFrame method.
 */

function poseToVec(pose){
  keys = pose.keypoints;

  console.log('keys: ', keys)

  vector = []; 
  poseVector = [];
  mean_x = -videoWidth/2;
  mean_y = -videoHeight/2;
  width = 0; 
  height = 0; 
  width_basis = 45;
  height_basis = 90;

  //resize
  for(var i=0; i<keys.length; i++){

    key = keys[i]; 
    vector.push(key.position);

    x = key.position.x;
    y = key.position.y;

    switch(key.part){
      case 'leftShoulder':
        width += x/2;  
        height -= y/2;
        break; 
      case 'rightShoulder':
        width -= x/2; 
        height -= y/2; 
        break;
      case 'leftHip':
        width += x/2;  
        height += y/2;   
        break;
      case 'rightHip':
        width -= x/2;
        height += y/2;   
        break;
      default:
        break; 
    }
  }

  width_scale = width_basis / width
  height_scale = height_basis / height

  for(var i=0; i<vector.length; i++){
    vector[i].x *= width_scale; 
    vector[i].y *= height_scale;
  }

  // reposition

  for(var i=0; i<keys.length; i++){
    key = keys[i];

    if(key.part=='leftShoulder' || key.part=='rightShoulder' || key.part=='leftHip' || key.part=='rightHip'){
      mean_x += key.position.x/4;
      mean_y += key.position.y/4;
    }
  }

  for(var i=0; i<vector.length; i++){
    vector[i].x -= mean_x
    vector[i].y -= mean_y;
    poseVector.push(vector[i].x)
    poseVector.push(vector[i].y)
  }

  console.log('vector: ', vector)
  console.log('poseVector: ', poseVector)

  return poseVector;
}

var isPlay = false;
var step = 0; 
var cnt = 0;

var start; 
var end;

function detectPoseInRealTime(video, net) {
  const canvas = document.getElementById('output');
  const ctx = canvas.getContext('2d');
  const flipHorizontal = true; // since images are being fed from a webcam

  canvas.width = 531;
  canvas.height = 531;

  async function poseDetectionFrame() {

    // Begin monitoring code for frames per second
    stats.begin();

    const imageScaleFactor = 0.5;
    const outputStride = 16;

    let poses = [];
    let minPoseConfidence;
    let minPartConfidence;

    const pose = await guiState.net.estimateSinglePose(video, imageScaleFactor, flipHorizontal, outputStride);
    poses.push(pose);

    poseVector = poseToVec(pose);
    poseVectors.push(poseVector);

    end = new Date(); 

    if(isPlay){
     if(step <= 70){
    	step += 1;
     } else{

      if(step <= 450){
		eucDis = euclideanDistance(poseVector, array[step-70]);
		step += 1;

		// temporary scoring algorithm for now. gotta improve further. 
		if(score > 2 && euclideanDistance(poseVectors[step-1], poseVectors[step-4]) < 2000){
		score -= 2; 
		} 

		if(score > 0 && eucDis > 4000){
		score -= 1;
		}  else if(score < 99 && eucDis <= 5500 && step < 261){
		score += 2;
		} else if(score < 98 && eucDis <= 6400 && step >= 261){
			score += 3;
		}
      }
      
      if(step > 261){
      	document.getElementById("score").style.display = 'none';
      } else{
      	document.getElementById("score").innerHTML = 'Score: ' + score;
      }

      if(end - start >= 58000){ // video = 58 seconds. 
      	var query = btoa("score")+btoa(score);
        window.open("result?"+query, "_self");
        return;
      }
     }
    }
    
    minPoseConfidence = Number(
      guiState.singlePoseDetection.minPoseConfidence);
    minPartConfidence = Number(
      guiState.singlePoseDetection.minPartConfidence);

    ctx.clearRect(0, 0, videoWidth, videoHeight);

    if (guiState.output.showVideo) {
      ctx.save();
      ctx.scale(-1, 1);
      ctx.translate(-videoWidth, 0);
      ctx.drawImage(video, 0, 0, videoWidth, videoHeight);
      ctx.restore();
    }

    poses.forEach(({ score, keypoints }) => {
      if (score >= minPoseConfidence) {
        if (guiState.output.showPoints) {
          drawKeypoints(keypoints, minPartConfidence, ctx);
        }
        if (guiState.output.showSkeleton) {
          drawSkeleton(keypoints, minPartConfidence, ctx);
        }
      }
    });

    // End monitoring code for frames per second
    stats.end();

    requestAnimationFrame(poseDetectionFrame);
  }

  poseDetectionFrame();
}

function euclideanDistance(poseVector1, poseVector2){
  distance = 0;
  for(var i=0; i<poseVector1.length; i++){
    distance += (poseVector1[i] - poseVector2[i])**2
  }
  distance *= 0.5
  return distance; 
}

